    (connect_pads (clearance 0.508))
    (min_thickness 0.254)
    (fill (thermal_gap 0.508) (thermal_bridge_width 0.508))
    (polygon
      (pts
        (xy 149.45 36.95)
        (xy -13.4 36.95)
        (xy -14.3 -85.65)
        (xy 149.45 -85.65)
      )
    )
  )'
